import { BrowserRouter as Router, Routes , Route} from 'react-router-dom';

import './App.css';

function App() {
  return (
    <Router>
    <div className="App">
      {/*Navbar*/}
      {/*SideDrawer*/}
      {/*Backdrop*/}
      <main>
        <Routes>
          <Route exact path = '/' component = {HomeScreen}/>
          <Route exact path = '/product/:id' component = {ProductScreen}/>
          <Route exact path = '/cart' component = {CartScreen}/>
        </Routes>
      </main>
      {/*HomeScreen*/}
      {/*ProductScreen*/}
      {/*ServicesScreen*/}
      {/*CartScreen*/}
    </div>
    </Router>
  );
}

export default App;
